LL reversenum(LL N)
{
  LL temp=0;
  while(N>0)
    {
      temp = temp*10 + N%10;
      N = N/10;
    }
  return temp;
}
bool isprime(LL n) 
{ 
  LL i; 
  if(n%2==0)
    return false;
  for(i=3;i*i<=n;i+=2) 
    { 
      while(n % i == 0) 
	{ 
	  return false;
	} 
    } 
  if (n > 1) return true; 
  return false;
}
